SET NAMES 'utf8'

create table block
(
    id        int auto_increment
        primary key,
    name      varchar(100) null,
    process   int          null,
    positionY int          null,
    positionX int          null
);

create table blockdatasourceparam
(
    id              int auto_increment
        primary key,
    block           int null,
    dataSourceParam int null,
    param           int null
);

create table datasource
(
    id        int auto_increment
        primary key,
    language  int          null,
    name      varchar(100) null,
    className varchar(100) null,
    jdbcUrl   varchar(100) null,
    username  varchar(100) null,
    password  varchar(100) null
);

esourcesmydatabase.db', null, null);
create table datasourceparam
(
    id          int auto_increment
        primary key,
    name        varchar(100) null,
    displayName varchar(100) null,
    type        int          null,
    dataSource  int          null
);

create table datatable
(
    id   int auto_increment
        primary key,
    name varchar(100) null
);

create table dynamicrequest
(
    id        int auto_increment
        primary key,
    url       varchar(100) null,
    processId int          null
);

create table execute
(
    id          int auto_increment
        primary key,
    method      int          null,
    executeName varchar(100) null,
    block       int          null
);

create table executeparam
(
    id                int auto_increment
        primary key,
    execute           int          null,
    pluginMethodParam varchar(100) null,
    param             varchar(300) null,
    fieldName         varchar(100) null,
    type              int          null
);

create table htmlparam
(
    id       int auto_increment
        primary key,
    width    int null,
    height   int null,
    top      int null,
    `left`   int null,
    `column` int null,
    row      int null,
    type     int null,
    template int null
);

create table next
(
    id       int auto_increment
        primary key,
    block    int          null,
    value    int          null,
    position int          null,
    name     varchar(100) null
);

create table nextrequirement
(
    id      int auto_increment
        primary key,
    next    int          null,
    param1  varchar(100) null,
    method  varchar(100) null,
    param2  varchar(100) null,
    pattern varchar(100) null
);

create table param
(
    id         int auto_increment
        primary key,
    paramValue varchar(100) null,
    belong     varchar(100) null
);

create table plugin
(
    id           int auto_increment
        primary key,
    type         int          null,
    language     int          null,
    name         varchar(100) null,
    introduction varchar(100) null,
    fileName     varchar(100) null,
    className    varchar(100) null,
    belongType   int          null
);

create table pluginmethod
(
    id           int auto_increment
        primary key,
    plugin       int          null,
    name         varchar(100) null,
    methodName   varchar(100) null,
    introduction varchar(100) null,
    type         int          null,
    returnType   int          null
);

create table pluginmethodparam
(
    id          int auto_increment
        primary key,
    name        varchar(100) null,
    type        int          null,
    position    int          null,
    method      int          null,
    displayName varchar(100) null
);

create table process
(
    id         int auto_increment
        primary key,
    name       varchar(100) null,
    startBlock int          null,
    endBlock   int          null,
    intro      varchar(100) null,
    dataSource int          null,
    url        varchar(200) null
);

create table processargument
(
    id        int auto_increment
        primary key,
    name      varchar(100) null,
    type      int          null,
    process   int          null,
    necessary int          null,
    complex   int          null,
    mutitype  int          null
);

create table processargumentcomplex
(
    id       int auto_increment
        primary key,
    argument int          not null,
    name     varchar(100) null
);

create table sequencerecord
(
    id        int auto_increment
        primary key,
    name      varchar(200) not null,
    seqNum    int          not null,
    time      float        not null,
    processId int          null,
    blockId   int          null,
    executeId int          null,
    remark    text         null
);

